import React from 'react'
import {Link} from "react-router-dom";

const Navs = () => {
  return (
    <nav className='nav'>
      <Link href="/" className='site-title'>
        John Sun
      </Link>
    <ul>
        <CustomLink href="/home">Home</CustomLink>
    </ul>
  </nav>
  )
}

export default Navs
